                tags: tags
            }
        ]
    });

    if (!!args["set_metric_annotations"]) {
        var i = 0;

        while(i < event.metrics.points.length) {
            event.annotations["io.sensu.bsm.selected_event_" + event.metrics.points[i].name] = event.metrics.points[i].value.toString();
            i++;
        }
    }
}

